  input: '"TEXT","F3A","","In regard to your letter dated, January 18, 2005, the contribution
    from Mr. Matthew G. Stuller was reported on the date the credit card was processed
    rather than the date the contribution was received by the Committee.  The contribution
    was received September 20, 2004, prior to the 48 hour reporting period therefore,
    it was not reported on Form 6.  This entry has been corrected and an amendment
    has been filed to reflect the correction.  The contribution from the Lemoine Company
    LLC is the same contribution as the contribution from Donald H. Broussard, Jr.
    reported on Form 6 10/28/2004.  Donald H. Broussard, Jr. is the only individual
    this contribution was attributed to.  The contribution from Conaway for Congress
    was reported in duplicate on the Form 6 filing 10/25/2004.  The error causing
    the contribution to be reported twice was fixed before the Form 3 filing therefore,
    the duplicate entry does not appear on Schedule A.  Finally, the Committee received
    late notice of its share of joint fundraising receipts.  An itemized listing is
    provided on Schedule A Line 12 of this amendment.  "'
